import axios from "axios";

const fetchAllChampions = () => {
  return axios
    .get(
      "https:/ddragon.leagueoflegends.com/cdn/10.4.1/data/en_US/champion.json"
    )
    .then((response) => {
      return response.data.data;
    });
};

const championServices = {
  fetchAllChampions,
};

export default championServices;
